import React, { useEffect, useState } from 'react';
import './Weather.css';

const Weather = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/data/weatherData.json')
      .then(res => res.json())
      .then(setData);
  }, []);

  if (!data) return <div>Î°úÎî© Ï§ë...</div>;

  return (
    <div className="weather-wrapper">
      {/* ÏÉÅÎã® */}
      <div className="header">
        <p className="location">üìç <strong>Ïù¥ÌôîÏó¨ÎåÄ</strong></p>
        <h1 className="temperature">{data.temperature}¬∞</h1>
        <div className="range">
          ÏµúÍ≥†: <span className="temp-bold">{data.temp_max}¬∞</span>&nbsp;&nbsp;
          ÏµúÏ†Ä: <span className="temp-bold">{data.temp_min}¬∞</span>
        </div>
      </div>

      {/* Ïò§ÎäòÏùò Ï§ÄÎπÑÎ¨º */}
      <div className="checklist-card">
        <div className="checklist-title">Ïò§ÎäòÏùò Ï§ÄÎπÑÎ¨ºÏùÄ?</div>
        <ul className="checklist-list">
          {data.checklist.map((item, idx) => (
            <li key={idx}>‚úîÔ∏è {item}</li>
          ))}
        </ul>
      </div>

      {/* ÎÇ†Ïî® ÌåÅ */}
      <p className="tip">{data.tip}</p>

      {/* Ïπ¥Îìú Í∑∏Î¶¨Îìú */}
      <div className="card-grid">
        {/* Í≥µÍµ¨ÌÖú */}
        <div className="card item-card">
          <div className="card-label">Ïò§ÎäòÏùò Í≥µÍµ¨ÌÖú Ï∂îÏ≤ú</div>
          <img src="/images/jacket.png" alt="Í≥µÍµ¨ÌÖú" className="card-image" />
          <p className="card-text">{data.item}</p>
        </div>

        {/* ÎØ∏ÏÑ∏Î®ºÏßÄ */}
        <div className="card dust-card">
          <div className="card-label">ÎØ∏ÏÑ∏Î®ºÏßÄ Ï†ïÎ≥¥</div>

          {/* PM10 */}
          <div className="dust-block">
            <img src="/images/pm10.png" alt="pm10" className="dust-img" />
            <div className="dust-info">
              <div className="dust-grade">{data.dust.pm10.grade}</div>
              <div className="dust-value">{data.dust.pm10.value}</div>
              <div className="unit">„éç/„é•</div>
            </div>
          </div>

          {/* PM25 */}
          <div className="dust-block">
            <img src="/images/pm25.png" alt="pm25" className="dust-img" />
            <div className="dust-info">
              <div className="dust-grade">{data.dust.pm25.grade}</div>
              <div className="dust-value">{data.dust.pm25.value}</div>
              <div className="unit">„éç/„é•</div>
            </div>
          </div>

          <p className="subtext">Ôºû ÎßàÏä§ÌÅ¨ Ï∂îÏ≤ú Ï†úÌíà Ôºú</p>
          <p className="subtext">Ôºû ÎØ∏ÏÑ∏Î®ºÏßÄ Í±¥Í∞ï Ï†ïÎ≥¥ Ôºú</p>
        </div>

        {/* Í∞ïÏàòÎüâ */}
        <div className="card rain-card">
          <div className="card-label">Í∞ïÏàòÎüâ</div>
          <p>Í∞ïÏàò ÌôïÎ•† {data.rain.chance}%</p>
          <p>Í∞ïÏàòÎüâ <strong>{data.rain.amount}mm</strong></p>
          <p className="subtext">Ôºû ÍµêÎÇ¥ Ïö∞ÏÇ∞ ÎåÄÏó¨ ÏÑúÎπÑÏä§ ÏïàÎÇ¥ Ôºú</p>
          <p className="subtext">Ôºû ÎπÑÏò§Îäî ÎÇ† ÏúÑÌóòÌïú Í∏∏ÏùÄ? Ôºú</p>
        </div>

        {/* ÏûêÏô∏ÏÑ† */}
        <div className="card uv-card">
          <div className="card-label">ÏûêÏô∏ÏÑ†</div>
          <p className="emoji">{data.uv.emoji}</p>
          <p>ÏûêÏô∏ÏÑ† ÏßÄÏàò {data.uv.index} - {data.uv.level}</p>
          <p className="subtext">Ôºû ÏûêÏô∏ÏÑ† Ï∞®Îã®Ï†ú Ï∂îÏ≤ú Ï†úÌíà Ôºú</p>
          <p className="subtext">Ôºû ÏñëÏÇ∞ Ï∂îÏ≤ú Ï†úÌíà Ôºú</p>
        </div>

        {/* ÏÖîÌãÄ */}
        <div className="card shuttle-card">
          <div className="card-label">ÏÖîÌãÄ Ïö¥Ìñâ Ï†ïÎ≥¥</div>
          {data.shuttle.routes.map((route, idx) => (
            <p key={idx}>{route}</p>
          ))}
          <p className="subtext">{data.shuttle.note}</p>
          <p className="subtext underline">Ôºû {data.shuttle.link} Ôºú</p>
        </div>
      </div>

      {/* ÌïòÎã® Î≤ÑÌäº */}
      <div className="button-area">
        <button>„Äâ Ïò§ÎäòÏùò Ïã§ÏãúÍ∞Ñ Í∏∞Ïò® ÏòàÎ≥¥ ÌôïÏù∏</button>
        <button>„Äâ ÎåÄÌîºÏÜå ÏúÑÏπò ÌôïÏù∏ÌïòÍ∏∞</button>
      </div>
    </div>
  );
};

export default WeatherPerfect;
